import React, { useState, useEffect, useRef } from "react";
import "../../css/CreateEvent.css";
import EventCard from "../../components/mainui/EventCard";

const CreateEvent = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    // fetch data from the backend
    fetch("http://localhost:8080/api/events")
      .then((res) => res.json())
      .then((data) => {
        setData(data);
      });
  }, []);

  // GET FROM API ONCE AUTHENTICATION IS SET UP
  const user = {
    email: "willsemail@email.com",
    firstName: "William",
    lastName: "Hellems-Moody",
  };

  const [notification, setNotification] = useState(false);
  const [notificationText, setNotificationText] = useState("");
  const fileInputRef = useRef(null);
  const [uploadedImageURL, setUploadedImageURL] = useState("");

  const [createForm, setCreateForm] = useState({
    eventName: "",
    email: "willsemail@email.com",
    eventDate: "",
    eventTime: "",
    location: "",
    postalCode: "",
    countryCode: "",
    city: "",
    description: "",
    category: "",
    image:
      "https://images.pexels.com/photos/2263436/pexels-photo-2263436.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",
    imageFile: null,
    tags: [],
  });

  // append tags to the tags array
  const appendTags = (tag) => {
    setCreateForm({
      ...createForm,
      tags: [...createForm.tags, tag],
    });
  };

  // {
  //     "eventName": "Paint The City",
  //     "email": "painterbuff@gmail.com",
  //     "eventDate": "2021-09-27T00:00:00.000+00:00",
  //     "eventTime": "04:05:06",
  //     "location": "30945 S Denver St",
  //     "postalCode": "80013",
  //     "countryCode": "US",
  //     "description": "Lorem ipsum nsectetur adipisicing elit.",
  //     "category": "Painting",
  //     "image": "https://images.pexels.com/photos/1887946/pexels-photo-1887946.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",
  //     "imageFile": null,
  //     "tags": [
  //         "painting",
  //         "social",
  //         "artists",
  //         "denver"
  //     ]
  // },

  const showNotification = () => {
    if (formReadyToSubmit) {
      setNotification(true);
      setTimeout(() => {
        setNotification(false);
      }, 2000);
    }
  };

  const handleChange = (e) => {
    setCreateForm({
      ...createForm,
      [e.target.name]: e.target.value,
    });
    console.log(createForm);
  };

  const [formReadyToSubmit, setFormReadyToSubmit] = useState(false);

  // Handling File Upload
  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setCreateForm({
      ...createForm,
      imageFile: file,
    });

    // Create a URL for the selected image file - Will create a temporary URL for the image as a blob, which can be used to preview the image.
    const imageURL = URL.createObjectURL(file);
    setUploadedImageURL(imageURL);
  };

  const handleUploadImage = () => {
    fileInputRef.current.click();
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Create a FormData object
    const formData = new FormData();

    // Create an object of the form fields
    const { imageFile, ...formDataFields } = createForm;

    for (const key in formDataFields) {
      formData.append(key, formDataFields[key]);
    }

    // Append the imageFile separately
    formData.append("imageFile", createForm.imageFile);
    console.log("formData: ", formData);
    console.log(createForm);

    // Make a POST request to your backend endpoint
    fetch("http://localhost:8080/api/events", {
      method: "POST",
      body: JSON.stringify(createForm),
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then((response) => {
        if (response.ok) {
          // The request was successful, you can handle the response here
          console.log("Event created successfully");
          // Reset the form or navigate to a different page
        } else {
          // The request failed, handle the error here
          console.error("Failed to create event");
          // Display an error message or handle the error as needed
        }
      })
      .catch((error) => {
        console.error("Error:", error);
        // Handle any network errors here
      });
  };

  return (
    <section className="create-event-component">
      <div className="create-event-container">
        {/* Create event form */}
        <form className="create-event-form" onSubmit={handleSubmit}>
          {/* Background image for card */}
          <div className="form-block image-option-block">
            <label htmlFor="event-image">Image</label>
            <input
              type="text"
              name="image"
              id="event-image"
              placeholder="Image URL"
              onChange={handleChange}
            />
            {/* Upload image file */}
            <div className="upload-image-container">
              <input
                type="file"
                name="imageFile"
                id="event-image-file"
                accept="image/*"
                onChange={handleFileChange}
                ref={fileInputRef}
                style={{ display: "none" }}
              />

              <label htmlFor="event-image-file" className="file-upload-label">
                Upload
              </label>
              <button
                className="upload-image-btn"
                onClick={handleUploadImage}
                type="button"
              >
                Upload
              </button>
            </div>
          </div>
          <h1 className="create-event-header">Create Event</h1>
          <br />
          <div className="form-block">
            <label htmlFor="event-name">Event</label>
            <input
              type="text"
              name="eventName"
              id="event-name"
              placeholder="Event Name"
              onChange={handleChange}
            />
          </div>
          <div className="form-block">
            <label htmlFor="event-date">Date</label>
            {/* DAY calendar input */}
            <input
              type="date"
              name="eventDate"
              id="event-date"
              onChange={handleChange}
            />

            {/* YEAR */}
          </div>
          <div className="form-block">
            <label htmlFor="event-name">Time</label>
            <select name="eventTime" id="event-time" onChange={handleChange}>
              {/* provide time format to match this 04:05:06 using 24hour format for morning and later times*/}
              <option value="10:00:00">10:00 AM</option>
              <option value="10:30:00">10:30 AM</option>
              <option value="11:00:00">11:00 AM</option>
              <option value="11:30:00">11:30 AM</option>
              <option value="12:00:00">12:00 PM</option>
              <option value="12:30:00">12:30 PM</option>
              <option value="13:00:00">1:00 PM</option>
              <option value="13:30:00">1:30 PM</option>
              <option value="14:00:00">2:00 PM</option>
              <option value="14:30:00">2:30 PM</option>
              <option value="15:00:00">3:00 PM</option>
              <option value="15:30:00">3:30 PM</option>
              <option value="16:00:00">4:00 PM</option>
              <option value="16:30:00">4:30 PM</option>
              <option value="17:00:00">5:00 PM</option>
              <option value="17:30:00">5:30 PM</option>
              <option value="18:00:00">6:00 PM</option>
              <option value="18:30:00">6:30 PM</option>
              <option value="19:00:00">7:00 PM</option>
              <option value="19:30:00">7:30 PM</option>
            </select>
          </div>
          <div className="form-block">
            <label htmlFor="event-location">Street</label>
            <input
              type="text"
              name="location"
              id="event-location"
              placeholder="(e.g. 1234 Main St)"
              onChange={handleChange}
            />
          </div>
          <div className="form-block">
            <label htmlFor="event-location">City</label>
            {/* City */}
            <input
              type="text"
              name="city"
              id="event-city"
              placeholder="(e.g. Denver)"
              onChange={handleChange}
            />
          </div>
          <div className="form-block">
            <label htmlFor="event-location">Zip</label>
            {/* City */}
            <input
              type="text"
              name="postalCode"
              id="event-postal-code"
              placeholder="(e.g. 80201)"
              onChange={handleChange}
            />
          </div>
          <div className="form-block">
            <label htmlFor="event-duration">Duration</label>
            <select name="duration" id="event-duration" onChange={handleChange}>
              <option value="1">1 Hour</option>
              <option value="2">2 Hours</option>
              <option value="3">3 Hours</option>
              <option value="4">4 Hours</option>
              <option value="5">5 Hours</option>
              <option value="6">6 Hours</option>
              <option value="7">7 Hours</option>
              <option value="8">8 Hours</option>
            </select>
          </div>
          {/* End of Desc */}
          <div className="form-description-container">
            <label htmlFor="description">Description</label>
            <textarea
              name="description"
              id="description"
              data-testid="description"
              placeholder="Event Description"
              cols="30"
              rows="10"
              onChange={handleChange}
            ></textarea>
          </div>
          {/* Category */}
          <div className="form-block">
            <label htmlFor="event-duration">Category</label>
            <select name="category" id="event-category" onChange={handleChange}>
              <option value="concert">Concert</option>
              <option value="sports">Sports</option>
              <option value="food">Food</option>
              <option value="outdoors">Outdoors</option>
              <option value="games">Games</option>
              <option value="other">Other</option>
            </select>
          </div>
          {/* Category */}
          {/* TAGS */}
          <div className="form-block">
            <label htmlFor="event-tags">Tags</label>
            <input
              type="text"
              name="tags"
              id="event-tags"
              placeholder="Add Tags"
              onKeyDown={(e) => {
                // restrict the tags to only 4 tags
                if (createForm.tags.length < 4) {
                  if (e.key === "Enter") {
                    appendTags(e.target.value);
                    e.target.value = "";
                  }
                } else if (createForm.tags.length === 4) {
                  setNotificationText("Only 4 tags allowed");
                  showNotification();
                }
              }}
            />
          </div>
          {/* TAGS */}
          {/* Create Event Button */}
          <div className="form-block">
            <button
              className="submit-btn"
              data-testid="submit-btn"
              type="submit"
            >
              Create Event
            </button>
            <p
              data-testid="notification"
              className={`notification
            ${notification ? "show" : ""}`}
            >
              {notificationText}
            </p>
          </div>
          <p className="caution-text">
            ⚠️ NOTE: Once this event is created a PDF will be accessible for a
            participants
          </p>
        </form>
        {/* Set Custom Fields for Create Event Card */}
        <EventCard
          {...createForm}
          user={user}
          backgroundImage={uploadedImageURL}
          width={600}
          height={600}
          fontSize={40}
        />
      </div>
    </section>
  );
};

export default CreateEvent;
